INSERT INTO `ec_reviews` VALUES (1,7,NULL,NULL,59,2.00,'Good app, good backup service and support. Good documentation.','published','2024-12-09 00:03:49','2024-12-09 00:03:49','[\"products\\/4-3.jpg\",\"products\\/41-1.jpg\",\"products\\/42.jpg\"]'),(2,7,NULL,NULL,23,1.00,'Those guys now what they are doing, the release such a good product that it\'s a pleasure to work with ! Even when I was stuck on the project, I created a ticket and the next day it was replied by the team. GOOD JOB guys. I love working with them :)','published','2024-12-09 00:03:49','2024-12-09 00:03:49','[\"products\\/1.jpg\",\"products\\/45-1.jpg\"]'),(3,7,NULL,NULL,40,3.00,'This web app is really good in design, code quality & features. Besides, the customer support provided by the Botble team was really fast & helpful. You guys are awesome!','published','2024-12-09 00:03:49','2024-12-09 00:03:49','[\"products\\/2-2.jpg\",\"products\\/23-2.jpg\",\"products\\/49-2.jpg\"]'),(4,9,NULL,NULL,42,5.00,'We have received brilliant service support and will be expanding the features with the developer. Nice product!','published','2024-12-09 00:03:49','2024-12-09 00:03:49','[\"products\\/26.jpg\",\"products\\/37.jpg\",\"products\\/55.jpg\",\"products\\/59-2.jpg\"]'),(5,5,NULL,NULL,26,5.00,'Second or third time that I buy a Botble product, happy with the products and support. You guys do a good job :)','published','2024-12-09 00:03:49','2024-12-09 00:03:49','[\"products\\/16.jpg\",\"products\\/53-1.jpg\",\"products\\/59-3.jpg\"]'),(6,4,NULL,NULL,23,4.00,'Great E-commerce system. And much more : Wonderful Customer Support.','published','2024-12-09 00:03:49','2024-12-09 00:03:49','[\"products\\/49.jpg\"]'),(7,7,NULL,NULL,36,2.00,'Cool template. Excellent code quality. The support responds very quickly, which is very rare on themeforest and codecanyon.net, I buy a lot of templates, and everyone will have a response from technical support for two or three days. Thanks to tech support. I recommend to buy.','pub